import React from 'react';
import "./members.css"
import {Member} from "../Data/members"
import Flag  from "../../images/flag.png"
import ProgressBar from "@ramonak/react-progress-bar";

const Members = ()=>{
    return(
        <div className='memberCards'>
            {Member.map((members) => {
                return (
                    <div className='members'>
                        <div className='memberImgs'>
                            <img src={Flag} alt=""  id="cover"/>
                            <img src={members.image} alt="" id='front' />
                        </div>
                        <div className='namesOthers'>
                            {members.names}

                        </div>
                        <div className='commitments'>
                            <div>
                                <span>District : </span>
                                    {members.place}
                            </div>div
                            <span>Commitments</span>
                            <ProgressBar completed={members.commitments} />
                        </div>


                    </div>
                )
            })}
        </div>

    )
}
export default Members
